import React, { useState } from 'react';
import './App.css';
import { uploadAudio, startMicRecording } from './audioUtils';

function App() {
  const [transcript, setTranscript] = useState('');
  const [chatInput, setChatInput] = useState('');
  const [chatHistory, setChatHistory] = useState([]);
  const [darkMode, setDarkMode] = useState(true);

  const handleUpload = async (e) => {
    const file = e.target.files[0];
    if (file) {
      const result = await uploadAudio(file);
      if (result?.text) {
        setTranscript(result.text);
      } else {
        alert("No voice detected in the audio.");
      }
    }
  };

  const handleMic = async () => {
    const result = await startMicRecording();
    if (result?.text) {
      setTranscript(result.text);
    } else {
      alert("No voice detected in the mic recording.");
    }
  };

  const handleChat = async () => {
    if (!chatInput.trim()) return;
    try {
      const response = await fetch('http://localhost:8000/chat', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ message: chatInput }),
      });
      const data = await response.json();
      if (data?.reply) {
        setChatHistory([...chatHistory, { user: chatInput, bot: data.reply }]);
        setChatInput('');
      } else {
        alert("No text returned from server.");
      }
    } catch {
      alert("Error contacting server.");
    }
  };

  return (
    <div className={darkMode ? 'app dark' : 'app light'}>
      <div className="sidebar">
        <img src="logo.png" alt="logo" className="logo" />
        <input type="file" accept="audio/*" id="upload" hidden onChange={handleUpload} />
        <label htmlFor="upload" className="btn">Upload</label>
        <button className="btn" onClick={handleMic}>Microphone</button>
        <button className="btn">Export PDF</button>
        <button className="btn">Analyze Tone</button>
        <div className="instructions">
          ðŸ“Œ How to use:<br />
          Upload or record audio<br />
          Interact via chat<br />
          Analyze tone<br />
          Export summary
        </div>
        <img src="help.png" alt="help" className="help-img" />
      </div>
      <div className="chatbox">
        <h2>AI Call Summarization Chatbot</h2>
        <div className="messages">
          {chatHistory.map((msg, idx) => (
            <div key={idx}>
              <div><strong>You:</strong> {msg.user}</div>
              <div><strong>Bot:</strong> {msg.bot}</div>
            </div>
          ))}
        </div>
        <div className="input-area">
          <input
            value={chatInput}
            onChange={(e) => setChatInput(e.target.value)}
            placeholder="Ask about the call..."
          />
          <button onClick={handleChat}>Send</button>
        </div>
      </div>
      <div className="transcript-panel">
        <div className="theme-toggle">
          <button onClick={() => setDarkMode(!darkMode)}>Toggle Theme</button>
        </div>
        <h4>Transcript Preview</h4>
        <textarea readOnly value={transcript} />
      </div>
    </div>
  );
}

export default App;
